import React from 'react';
import Navbar from './navbar.js';

function Dashboard() {
  return (
    <div className="h-screen flex justify-center items-center">
      <Navbar />
      <div className="w-5/6 h-5/6 bg-darkgrey rounded-xl shadow-xl p-8">
      <div className="w-1/3 bg-white rounded-lg shadow-md p-4">
      <h2 className="text-xl font-semibold mb-4">Number of comments</h2>
      {/* Content for Number of comments */}
    </div>
    <div className="w-1/3 bg-white rounded-lg shadow-md p-4">
      <h2 className="text-xl font-semibold mb-4">Number of Users engaged</h2>
      {/* Content for Number of Users engaged */}
    </div>
    <div className="w-1/3 bg-white rounded-lg shadow-md p-4">
      <h2 className="text-xl font-semibold mb-4">Last commented</h2>
      {/* Content for Last commented */}
    </div>
      </div>
    </div>
  );
}

export default Dashboard;
